# 1 "CLex.fsl"
 

(* Lexer specification for micro-C, a small imperative language *)

module CLex

open Microsoft.FSharp.Text.Lexing
open CPar;

let lexemeAsString lexbuf =
    LexBuffer<char>.LexemeString lexbuf

// Scan keywords as identifiers and use this function to distinguish them.
// NOTE: If the set of keywords is large, use a hashtable instead.
let keyword s =
    match s with
    | "int"     -> INT
    | "char"    -> CHAR
    | "if"      -> IF
    | "else"    -> ELSE
    | "while"   -> WHILE
    | "true"    -> CSTBOOL 1
    | "false"   -> CSTBOOL 0
    | "print"   -> PRINT
    | "println" -> PRINTLN
    | "void"    -> VOID
    | "null"    -> NULL
    | "return"  -> RETURN
    | _         -> NAME s

let cEscape s =
    match s with
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible mini-C escape"

